const Header = () =>{
    const [time, setTime] = useState();

    const curtime = newDate().toLocalTimeString();
        
    return(

        <>

            <div className="main_content">   
            <div className="header">       
              <div className="content_box">              
                  
                    <h1>Google Keep <span className="cuttime"> {cutTime} - {time} </span></h1>
                  
              </div>  
            </div>
            </div>
            


        </>
    );
}
export default Header;
